import React, { Component } from "react";

class HomePage extends Component {
    componentWillMount() {
        snaplist().then((value) => {
            console.log(value);
        });
    }

    render() {
        return(
            <div>
                <h2>Hello</h2>
            </div>
        )
    }
}

const snaplist = () => {
    return fetch("http://localhost:8080/snaplist").then((response) => {
        return response.json();
    });
}

export default HomePage;
